	function fileHandler(that, e) {
    	e = e || window.event; // get window.event if e argument missing (in IE)   
        if (e.preventDefault) {
            e.preventDefault();
        } // stops the browser from redirecting off to the image.
        var files;
		if(e.dataTransfer) {
        	var dt = e.dataTransfer;
       		files = dt.files;
        } else {
        	files = that.files;
        }
		
        //only pick first file uploaded. 
        var file = files[0];
        //only allow selected file types
        if(file && file.type!="undefined") {
	        if(allowedFiles.includes(file.type)) {
	        	var reader = new FileReader();
	            reader.readAsDataURL(file);
	            
	            //on image load
	            addEventHandler(reader, 'loadend', function (e, file) {
	                var bin = this.result;
	                var num = that.getAttribute('id').slice(-1);
	                //resize image to maintain aspect ratio
					fullSize[num] = file;
					$("#clickdrag").fadeOut("slow");
					$("#load").fadeOut("slow");
					$("#next").fadeOut("slow");
					window.setTimeout(imageHandler, 600, bin, num);
//					}
	            }.bindToEventHandler(file));
				} else {
					//wrong file type
					$(status).text("The goarmy.com Reserve Photo Gen only accepts PNG, GIF, and JPG file types.");
				}
        }
        softReset();
        return false;
    }
	
