	function imageHandler(file, num) {
		var img = new Image();
		img.onload = function() {
			image = img;
			//height = $('#list'+num).height();
        	width = $('#list'+num).width();
			height = Math.max(400, window.innerHeight/2);
        	heightScale = 1;
        	widthScale = 1;
        	
        	//Scale image
        	if(image.height > 1000) {
        		heightScale = image.height/1000;
        	}
        	scale = heightScale;
        	if(image.width > 3000) {
        		widthScale = image.width/1000;
        	}
        	if(widthScale>scale) {
        		scale = widthScale;
        	}
			
			bins[num-1] = file;
			//if there is a canvas; kill it
			if(document.getElementById('list'+num).children[0]) {
				$('#list'+num).empty();
			}
			//setup canvas to render image
			var canvas = document.createElement("canvas");
			canvas.width = width;
			canvas.height = height; 
			canvas.id = 'upload';
			
			//draw border
			var cctx = canvas.getContext('2d');
			cctx.fillStyle = "#000000";
			cctx.fillRect(0,0,width,height);
			
			//center image
			imageX = canvas.width/2 - (img.width/scale/2);
			imageY = canvas.height/2 - (img.height/scale/2);
			
			//draw image
			cctx.drawImage(img, imageX, imageY, img.width/scale, img.height/scale);
			$("#list"+num).append(canvas);
			
			//Kill slider if a slider already exists
			if (slider.children.length > 0) {
				slider.noUiSlider.destroy();
			}
			noUiSlider.create(slider, {
				start: 1,
				connect: [true, true],
				range: {
					'min': .005,
					'max': 2.5
				}
			});
			slider.noUiSlider.on('slide', sliderChanged);
			//UPDATE: don't know why that line was there.  All we do is hide slider so we don't need to reset.
			//We also reset the zoom level since that's stored separately.
	    	//slider.noUiSlider.set(zoomLevel[frame]);
			zoomLevel[frame] = 1;
			
			//$("#slider").slider("enable");
			
			$("#slider").fadeIn("slow");
			$("#rotate").fadeIn("slow");
			$("#drag").fadeIn("slow");
		
			ready = true; //can continue to next slide
			$("#next").fadeIn("slow");
			drawGuides(canvas);
			canvasHandler(canvas, img, num);
			
            $(status).text(bins.length < 2 ? 'Loaded 100% of file ' + bins.length + ' of ' + 2 + '...' : 'Done loading. processed ' + bins.length + ' files.');
		};
		img.src = file;
	}
	
	function canvasHandler(canvas, image3, num) {
	//console.log(num);
					//console.log(image);
		disableCanvas = false;
		var ctx = canvas.getContext('2d');
		var offset = $(canvas).offset();
		var offsetX = offset.left;
		var offsetY = offset.top;
		
		var startX = 0;
    	var startY = 0;
    	var imageWidth = 0;
    	var imageHeight = 0;
    	
    	var isDraggingImage = false;
    	
    	function imageDetect(x, y) {
    		return (x > imageX && x < imageX + imageWidth && y > imageY && y < imageY + imageHeight);
    	}
    	
    	function handleMouseDown(e) {
    		if (e.preventDefault) {
        		e.preventDefault();
            }
			if (disableCanvas) return;
			startX = parseInt(e.clientX - offsetX);
			startY = parseInt(e.clientY - offsetY);
			isDraggingImage = true;
		}
    	
    	function handleMouseUp(e) {
    		if (e.preventDefault) {
        		e.preventDefault();
            }
			isDraggingImage = false;
			//draw();
    	}
    	
		function handleMouseMove(e) {
			if (e.preventDefault) {
	    		e.preventDefault();
	        }
			if(isDraggingImage) {
				if(time) {
				
					console.log("test");
					time = 0;
					//$("#drag").fadeOut("slow");
					var mouseX = parseInt(e.clientX - offsetX);
					var mouseY = parseInt(e.clientY - offsetY);
					var moveX = mouseX - startX;
					var moveY = mouseY - startY;
					
					//checks for moving image
					if(image)
					
					draw(canvas, image, imageX+moveX*2, imageY+moveY*2);
					imageX+=(moveX*2);
					imageY+=(moveY*2);
					startX = mouseX;
					startY = mouseY;
				} else {
					time = 1;
				}
			}
		}
		
		function handleMouseEnter(e) {
			if (e.preventDefault) {
	    		e.preventDefault();
	        }
		}

		function handleMouseOut(e) {
			if (e.preventDefault) {
	    		e.preventDefault();
	        }
			isDraggingImage = false;
			//handleMouseUp(e);
		}

    	$(canvas).hover(function(e) {
    		handleMouseEnter(e);
    	}, function(e) {
    		handleMouseOut(e);
    	}).mousemove(function(e) {
    		handleMouseMove(e);
    	}).mouseup(function(e) {
    		handleMouseUp(e);
    	}).mousedown(function(e) {
    		handleMouseDown(e);
    	}).mouseout(function(e) {
    		handleMouseOut(e);
    	});
    	
    	function handleTouchStart(e) {
    		if (e.touches.length === 0 ) return;
    		if (e.preventDefault) {
	    		e.preventDefault();
	        }		
			if (disableCanvas) return;
    		startX = parseInt(e.touches[0].clientX - offsetX);
			startY = parseInt(e.touches[0].clientY - offsetY);
			isDraggingImage = true;
    	}
    	
    	function handleTouchEnd(e) {
    		if (e.preventDefault) {
	    		e.preventDefault();
	        }
			isDraggingImage = false;
    	}
    	
    	function handleTouchMove(e) {
    		if (e.touches.length === 0 ) return;
    		if (e.preventDefault) {
	    		e.preventDefault();
	        }

			if(isDraggingImage) {
				//$("#drag").fadeOut("slow");
				var mouseX = parseInt(e.touches[0].pageX - offsetX);
				var mouseY = parseInt(e.touches[0].pageY - offsetY);
				var moveX = mouseX - startX;
				var moveY = mouseY - startY;
				
				//checks for moving image
				if(image)
				
				draw(canvas, image, imageX+parseInt(moveX/2), imageY+parseInt(moveY/2), num);
				imageX+=parseInt(moveX/2);
				imageY+=parseInt(moveY/2);
				startX = mouseX;
				startY = mouseY;
			}
    	}
    	
    	function handleTouchCancel(e) {
    		if (e.preventDefault) {
	    		e.preventDefault();
	        }
			isDraggingImage = false;
    	}
    	canvas.addEventListener('touchstart', handleTouchStart, true);
    	canvas.addEventListener('touchend', handleTouchEnd, true);
    	canvas.addEventListener('touchmove', handleTouchMove, true);
    	canvas.addEventListener('touchcancel', handleTouchCancel, true);
   }
	
	function checkSupport() {
		var testCanvas = document.createElement('canvas');
		if(!!(testCanvas.getContext && testCanvas.getContext('2d'))) {
			if(window.FileReader) {
				setup();
			} else {
				//failes fileReader check
				$("#error div").text("Your browser does not support this web app.");
				$("#error").fadeIn("fast");
			}
		} else {
			//fails Canvas check
			$("#error div").text("Your browser does not support this web app.");
			$("#error").fadeIn("fast");
		}
	}
	
