	function draw(canvas, image, imagex, imagey) {
		var ctx = canvas.getContext('2d');
		ctx.fillStyle="black";
		ctx.fillRect(0,0,canvas.width,canvas.height);
		ctx.drawImage(image, imagex, imagey, Math.floor(image.width/scale/zoomLevel[frame]), Math.floor(image.height/scale/zoomLevel[frame]));
		drawGuides(canvas);
	}
	
