	function drawGuides(canvas) {
		var ctx = canvas.getContext('2d');
		var large = Math.floor((canvas.width-cWidth)/2);
		var small = Math.floor((canvas.height-400)/2);
		ctx.fillStyle = 'rgba(110, 110, 110, 0.6)';
		//left Side
		ctx.fillRect(0, 0, large, canvas.height);
		//right side
		ctx.fillRect(canvas.width-large, 0, canvas.width, canvas.height);
		if(small > 0) {
			//top
			//ctx.fillRect(large, 0, canvas.width-large-large, small);
			//bottom
			ctx.fillRect(large, canvas.height-(small*2), canvas.width-large-large, canvas.height);
		}
	}
	
